import React from "react";
import "../styles/_main.scss"
import Card from "./Card";
import faker from "faker";

const App = () => {
      return (
            <div>
                  <nav className={"test"}>Narbar ska läggas här</nav>
                  <Card image={faker.image.avatar(1)} />
                  <Card image={faker.image.avatar(2)} />

            </div>

      )
}
export default App;
